import sqlite3

def add_authors():
    conn = sqlite3.connect('../bam.db')
    c = conn.cursor()

    c.execute("DELETE from authors")

    # Sample data for authors
    authors = [
        ('Justin', 'Wood', 'data:image/jpeg;base64,', 'https://luddy.indiana.edu/contact/profile/?Justin_Wood'),
        ('Samantha', 'Wood', 'data:image/jpeg;base64,', 'https://luddy.indiana.edu/contact/profile/index.html?Samantha_Wood'),
        ('Lalit', 'Pandey', 'data:image/jpeg;base64,', 'https://www.linkedin.com/in/lpp/'),
        ('Joshua', 'McGraw', 'data:image/jpeg;base64,', 'https://www.buildingamind.com/team'),
    ]
    
    # Insert sample authors
    c.executemany('''
    INSERT INTO authors (author_first_name, author_last_name, author_image, author_website)
    VALUES (?, ?, ?, ?)
    ''', authors)

    conn.commit()
    conn.close()

if __name__ == '__main__':
    add_authors()
    print("Authors added successfully.")